func (c *current) onstart2(scope any) (any, error) {
	return []any{scope}, nil
}

func (p *parser) callonstart2() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onstart2(stack["scope"])
}

